,"plotOptions-funnel-dataLabels--connectorWidth":{id:"plotOptions-funnel-dataLabels--connectorWidth",shortName:"connectorWidth",dataType:"number",description:'<p>The width of the line connecting the data label to the pie slice.</p>\r\n\r\n<p>In <a href="http://www.highcharts.com/docs/chart-design-and-style/style-by-css">styled mode</a>, the connector stroke width is given in the <code>.highcharts-data-label-connector</code> class.</p>'},"plotOptions-funnel-dataLabels--crop":{id:"plotOptions-funnel-dataLabels--crop",shortName:"crop",dataType:"boolean",description:'Whether to hide data labels that are outside the plot area. By default, the data label is moved inside the plot area according to the <a href="#plotOptions.series.dataLabels.overflow">overflow</a> option.'},"plotOptions-funnel-dataLabels--defer":{id:"plotOptions-funnel-dataLabels--defer",shortName:"defer",dataType:"boolean",description:"Whether to defer displaying the data labels until the initial series animation has finished."},"plotOptions-funnel-dataLabels--distance":{id:"plotOptions-funnel-dataLabels--distance",shortName:"distance",dataType:"number",description:"The distance of the data label from the pie's edge. Negative numbers put the data label on top of the pie slices. Connectors are only shown for data labels outside the pie."},"plotOptions-funnel-dataLabels--enabled":{id:"plotOptions-funnel-dataLabels--enabled",shortName:"enabled",dataType:"boolean",description:"Enable or disable the data labels."},"plotOptions-funnel-dataLabels--format":{id:"plotOptions-funnel-dataLabels--format",shortName:"format",dataType:"string",description:'A <a href="http://www.highcharts.com/docs/chart-concepts/labels-and-string-formatting">format string</a> for the data label. Available variables are the same as for <code>formatter</code>.'},"plotOptions-funnel-dataLabels--inside":{id:"plotOptions-funnel-dataLabels--inside",shortName:"inside",dataType:"boolean",description:"For points with an extent, like columns, whether to align the data label inside the box or to the actual value point. Defaults to <code>false</code> in most cases, <code>true</code> in stacked columns."},"plotOptions-funnel-dataLabels--overflow":{id:"plotOptions-funnel-dataLabels--overflow",shortName:"overflow",dataType:"string",description:'How to handle data labels that flow outside the plot area. The default is <code>justify</code>, which aligns them inside the plot area. For columns and bars, this means it will be moved inside the bar. To display data labels outside the plot area, set <code>crop</code> to <code>false</code> and <code>overflow</code> to <code>"none"</code>.',values:'["justify", "none"]'},"plotOptions-funnel-dataLabels--padding":{id:"plotOptions-funnel-dataLabels--padding",shortName:"padding",dataType:"number",description:"When either the <code>borderWidth</code> or the <code>backgroundColor</code> is set, this\t\tis the padding within the box."},"plotOptions-funnel-dataLabels--reserveSpace":{id:"plotOptions-funnel-dataLabels--reserveSpace",shortName:"reserveSpace",dataType:"boolean",description:"Whether to reserve space for the labels. This can be turned off when for example the labels are rendered inside the plot area instead of outside."},"plotOptions-funnel-dataLabels--rotation":{id:"plotOptions-funnel-dataLabels--rotation",shortName:"rotation",dataType:"number",description:"Text rotation in degrees. Note that due to a more complex structure, backgrounds, borders and padding will be lost on a rotated data label."},"plotOptions-funnel-dataLabels--shape":{id:"plotOptions-funnel-dataLabels--shape",shortName:"shape",dataType:"string",description:"The name of a symbol to use for the border around the label. Symbols are predefined functions on the Renderer object."},"plotOptions-funnel-dataLabels--softConnector":{id:"plotOptions-funnel-dataLabels--softConnector",shortName:"softConnector",dataType:"boolean",description:"Whether to render the connector as a soft arc or a line with sharp break."},